import React from "react";
import "./home.css"
import Header from "../Header/Header"
import Footer from "../Footer/Footer"
import Doctor from "../image/add doctor.png"
import Nurse from "../image/add nurse.png"
import Pharmacist from "../image/add pharmacist.png"
import Admin from "../image/add admin.png"


function Home(props){
    const contents=[{
        "to":"Doctor",
        "img":Doctor
    },{
        "to":"Nurse",
        "img":Nurse
    },{
        "to":"Pharmacist",
        "img":Pharmacist
    }];
    const contentBoxs=contents.map((content)=>{
        return (<ContentBox
        img={content.img}
        to={content.to}/>);
    });
return(
    <section className="homePage">
    <Header pageTitle={"Home"}/>
    <section className="homeContent">
        {contentBoxs}
    </section>
    <Footer/>
    </section>
);
}
function ContentBox(props){
    return(
    <div className="singleContent">
        <h4>helloword</h4>
        <img src={props.img} alt="icon" className="contentImg"/>
        <div className="buttonContainer">
            <button className="contentButtons">Add {props.to}</button>
            <button className="contentButtons">Remove {props.to}</button>
        </div>
        
    </div>);
}

export default Home;
